function I = fcnK5R(S, T, u, alpha, F, tol)
t2 = F .^ 2;t5 = sqrt(t2 .* S + u);t8 = S .* u;t9 = -t8 + u;t10 = 0.1e1 ./ t9;t11 = t10 .* u;t12 = sqrt(-u);t13 = F - t12;t14 = t13 .^ 2;t16 = t12 .* S;t17 = t13 .* t16;t20 = sqrt(t14 .* S + 0.2e1 .* t17 - t8 + u);t21 = 0.1e1 ./ t20;t23 = t10 .* t12;t28 = sqrt(t9);t31 = 0.1e1 ./ t28 ./ t9 .* u;t34 = 0.1e1 ./ t13;t36 = log(0.2e1 .* t34 .* (t20 .* t28 + t17 - t8 + u));t38 = F + t12;t39 = t38 .^ 2;t41 = t38 .* t16;t44 = sqrt(t39 .* S - 0.2e1 .* t41 - t8 + u);t45 = 0.1e1 ./ t44;t53 = 0.1e1 ./ t38;t55 = log(0.2e1 .* t53 .* (t44 .* t28 - t41 - t8 + u));t57 = t12 .* u;t62 = u .^ 2;t63 = S .* t62;t64 = t9 .^ 2;t65 = 0.1e1 ./ t64;t66 = t21 .* t65;t69 = S .^ 2;t70 = t69 .* t57;t75 = 0.1e1 ./ t28 ./ t64;t83 = t45 .* t65;t92 = -0.1e1 ./ t5 ./ S - t21 .* t11 + 0.3e1 ./ 0.2e1 .* F .* S .* t21 .* t23 + t36 .* t31 - t45 .* t11 - 0.3e1 ./ 0.2e1 .* t23 .* F .* S .* t45 + t55 .* t31 + t21 .* t34 .* t10 .* t57 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t66 .* t63 + 0.3e1 ./ 0.4e1 .* F .* t66 .* t70 + 0.3e1 ./ 0.4e1 .* t36 .* t75 .* t63 - t45 .* t53 .* t10 .* t57 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t83 .* t63 - 0.3e1 ./ 0.4e1 .* F .* t83 .* t70 + 0.3e1 ./ 0.4e1 .* t55 .* t75 .* t63;
